import "./styles/Support-Rehoboth.css"

export default function SupportRehoboth() {
    return (
        <div>
            <Top/>
            <Bodyfirst/>
        </div>
    )
}

const Top = () => {
    return (
        <div className="top">
            <p>Show your support</p>
            <button>Give</button>
        </div>
    )
}

const Bodyfirst = () => {
    return (
        <div>
            <blockquote>
                <p>
                "We strive to help people in however ways we can.
                Your happiness is our happiness" <br/>
                <p></p>
                </p>
            </blockquote>
        </div>
    )
}
